import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Navbar from './components/navbar';
import {} from './components/shop';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<h1>Home</h1>} />
          <Route path="/cart" element={<h1>Cart</h1>} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
